import React, { Component } from 'react';
import Post from "./components/post";
import "./post.css";

const postArray=[
  {
    content:'hsuahsuhas',
    time:'16:23',
    author: 'eu',
    initialLikes:2
  }
,
  {
    content:'texto2',
    time:'10:51',
    author: 'eu',
    initialLikes:0
  }

]



class App extends Component{
render(){
  return(

    <div>
      <h1>Minha rede social</h1>
      {postArray.map((post,i) => {
        return(
        <Post 
          key={i}
          time={post.time}>
          {post.content} 


        </Post>
        )
      })}
      <Post text={'texto do primeiro post'} 
      time={'13:00'}
      />

    </div>
    )
}

}


export default App;
